import React from "react";
import styled from "styled-components";

const Container = styled.div`
  width: 99vw;
  min-height: 50px;
  margin-top: 10px;
  background-color: #252525;

  @media (max-width: 600px) {
    width: 100vw;
  }
`;

const Text = styled.p`
  color: #9f7bc9;
  text-align: center;
`;

class Footer extends React.Component {
  render() {
    return (
      <Container>
        <Text></Text>
      </Container>
    );
  }
}

export default Footer;
